export default function convertTime(time) {
  let res = "";
  let now = Date.now();
  let then = new Date(time).getTime();
  let deltaSeconds = (now - then) / 1000;
  if (deltaSeconds < 60) {
    res = deltaSeconds + "s";
  } else if (deltaSeconds >= 60 && deltaSeconds <= 3600) {
    res = deltaSeconds / 60 + "m";
  } 

  console.log(deltaSeconds);
  return res;
}
